		alt="로고"/>
        </div>
        <nav_style.Nav_ul>
            <nav_style.Menu_li>영화</nav_style.Menu_li>
            <nav_style.Menu_li><Link to={`/page${page}`}>TV 프로그램</Link></nav_style.Menu_li>
            <nav_style.Menu_li>인물</nav_style.Menu_li>
        </nav_style.Nav_ul>
        </nav_style.Nav_div>
    );
}

